window.bookSummaryJSON = "<p><b>This action-packed, post-apocalyptic series is now available in a box set of over 1,500 pages!</b>&nbsp;</p> <p>When civilization collapses, only the strong will survive.&nbsp;</p> <p>Josh and Maxine Standing’s marriage is circling the drain. But the fractured family of four has never needed each other more than when a supernova EMP strikes Earth and sends humanity back to the Stone Age.&nbsp;</p> <p>The shrieks of a dying civilization echo all around as they combat the chaos to reach the West Virginian family farm. However, it’s not just a firefight for valuable resources that awaits them when long-festering secrets and betrayals come to light and threaten to permanently tear the Standings apart.&nbsp;</p> <p>Black and white no longer exist in a post-apocalyptic world swirling with shades of gray, and the Standings must find a way to survive the dark matter hurricane and stitch their frayed family back together. Or face complete annihilation at the hands of a maniacal madman who will do anything - and destroy anyone - in his quest to dominate.&nbsp;</p> <p>This thrilling post-apocalyptic box set includes all four novels in the Supernova EMP series:&nbsp;</p> <p><i>Dark End</i> <br> <i>Deep End</i> <br> <i>Bitter End</i> <br> <i>Final End</i>&nbsp;</p> <p>Prepper survivalist author Grace Hamilton invites you to step into a post-apocalyptic, EMP-ravaged world filled with strong, resourceful characters, survivalist knowledge, and edge-of-your seat action.&nbsp;</p>"; 
